def getCoorsFromJsonFile(filepath):
    with open(filepath, 'rt', encoding='UTF8') as f:
        json_data = json.load(f)

    listCoords = []
    segmentations = json_data["Image_Annotation"]["annotations"]
    for item in segmentations:
        listX = item["segmentation"]["all_points_x"]
        listY = item["segmentation"]["all_points_y"]
        listCoord = []

        for idx, x in enumerate(listX):
            listCoord.append([x, listY[idx]])
        
        listCoords.append(listCoord)

    return listCoords


def getTempature(rgb_value):
    searchOk = False
    result = None
    for item in legend_value:
        if item[1] == rgb_value :
            searchOk=True
            result = item[2]
            break

    if searchOk==False:
        min_distance = 100000
        result = None
        for item in legend_value:
            distance = ((rgb_value[0]-item[1][0])**2 + (rgb_value[1]-item[1][1])**2 + (rgb_value[2]-item[1][2])**2) ** 0.5
            if distance < min_distance :
                min_distance = distance
                result = item[2]

    return result


#   rgb  
def getPolygonInnerRgb(target_image, coords):

    # ...
    img_array = np.fromfile(target_image, np.uint8)
    image = cv2.imdecode(img_array, cv2.IMREAD_COLOR)

    #   
    polygon_points = np.array(coords, np.int32)

    #       
    mask = np.zeros(image.shape[:2], dtype=np.uint8)
    cv2.fillPoly(mask, [polygon_points], 255)

    #       
    pixels = cv2.findNonZero(mask)

    #  
    resultRgbList = []
    count = 0
    for pixel in pixels:
        if count>=10:
            break

        x, y = pixel[0]
        img = Image.open(target_image)
        pixel_rgb = img.getpixel((x,y))
        pixel_rgb = (pixel_rgb[0], pixel_rgb[1], pixel_rgb[2])
        resultRgbList.append(pixel_rgb)
        count = count + 1

    return resultRgbList